import React, { useState, useEffect } from "react";
// import "./Styles.css";

function Contact() {
  useEffect(() => {
    fetching();
  }, []);
  const [data, setData] = useState([]);
  const fetching = () => {
    fetch(
      "https://rapidapi.p.rapidapi.com/geocode/json?address=164%20Townsend%20St.%2C%20San%20Francisco%2C%20CA&language=en",
      {
        method: "GET",
        address: "164 Townsend St., San Francisco, CA",
        headers: {
          "x-rapidapi-key":
            "bd538a0cbfmshd5d6b51c7ced8d9p1b1e48jsn623334bcb300",
          "x-rapidapi-host": "google-maps-geocoding.p.rapidapi.com",
        },
      }
    )
      .then((response) => {
        console.log(response);
        setData(response);
      })
      .catch((err) => {
        console.error(err);
      });
  };
  return (
    <div className="centered">
      <h2>Contact and Map</h2>
      <iframe className="mapContant" src={data.url}></iframe>
    </div>
  );
}

export default Contact;
